import{_ as e,c as o,o as l,a1 as d}from"./chunks/framework.BwTyoF0R.js";const p=JSON.parse('{"title":"Restful API 常用 method","description":"","frontmatter":{},"headers":[],"relativePath":"面试刷题-wiki/03-前端基础知识/x2-文本小节-Restful-API-method.md","filePath":"面试刷题-wiki/03-前端基础知识/x2-文本小节-Restful-API-method.md"}'),t={name:"面试刷题-wiki/03-前端基础知识/x2-文本小节-Restful-API-method.md"},a=d('<h1 id="restful-api-常用-method" tabindex="-1">Restful API 常用 method <a class="header-anchor" href="#restful-api-常用-method" aria-label="Permalink to &quot;Restful API 常用 method&quot;">​</a></h1><p>以一个博客项目为例，实现“增删改查”功能，使用 Restful API 的接口设计如下</p><h2 id="新增博客" tabindex="-1">新增博客 <a class="header-anchor" href="#新增博客" aria-label="Permalink to &quot;新增博客&quot;">​</a></h2><ul><li>url <code>http://xxx.com/api/blog</code></li><li>method <code>POST</code> （request body 中有博客的内容）</li></ul><h2 id="删除博客" tabindex="-1">删除博客 <a class="header-anchor" href="#删除博客" aria-label="Permalink to &quot;删除博客&quot;">​</a></h2><ul><li>url <code>http://xxx.com/api/blog/100</code> （<code>100</code> 为博客的 id）</li><li>method <code>DELETE</code></li></ul><h2 id="修改博客内容" tabindex="-1">修改博客内容 <a class="header-anchor" href="#修改博客内容" aria-label="Permalink to &quot;修改博客内容&quot;">​</a></h2><ul><li>url <code>http://xxx.com/api/blog/100</code> （<code>100</code> 为博客的 id）</li><li>method <code>PATCH</code> （request body 中有博客的内容）</li></ul><p>另，跟 <code>PATCH</code> 很像的还有 <code>PUT</code> 方法，两者有差别</p><ul><li><code>PUT</code> 更新全部内容，即替换</li><li><code>PATCH</code> 更新部分内容 —— 更加常用</li></ul><h2 id="查询博客" tabindex="-1">查询博客 <a class="header-anchor" href="#查询博客" aria-label="Permalink to &quot;查询博客&quot;">​</a></h2><p>查询单个博客</p><ul><li>url <code>http://xxx.com/api/blog/100</code> （<code>100</code> 为博客的 id）</li><li>method <code>GET</code></li></ul><p>查询博客列表</p><ul><li>url <code>http://xxx.com/api/blog</code></li><li>method <code>GET</code></li></ul><h2 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h2><ul><li><code>GET</code> 查询</li><li><code>POST</code> 新增</li><li><code>PATCH</code> 更新</li><li><code>DELETE</code> 删除</li></ul>',17),i=[a];function c(r,h,u,s,n,m){return l(),o("div",null,i)}const x=e(t,[["render",c]]);export{p as __pageData,x as default};
